#########################################################################
# Start Journal CRUD  [ Journal - journal ]
#########################################################################
@api_view(['POST','PUT', 'DELETE' ])
def JournalCUDView(request):
    trail = {}

    # Create Factor
    if request.method == 'POST':
        print(request.data)
        serializer = JournalCreateSerializer(data=request.data)
        if serializer.is_valid():
            new_object = serializer.save(user=request.user)
            trail['message'] = "Journal Sucessfully Created"
            trail['data'] = serializer.data
            return Response(trail, status=status.HTTP_200_OK)
        else:
            trail = serializer.errors
            return Response(trail, status=status.HTTP_403_FORBIDDEN)


    # Edit Factor
    if request.method == 'PUT':
        try:
            factor = JournalModel.objects.get(journal_id=request.data.get("journal_id"))
        except:
            raise serializers.ValidationError('Not Found')

        serializer = JournalEditSerializer(factor, data=request.data)
        if serializer.is_valid():
            serializer.save()
            trail["message"] = "Journal Successfully Updated"
            trail["data"] =  serializer.data
            return Response(trail, status=status.HTTP_200_OK)
        else:
            trail = serializer.errors
            return Response(trail, status=status.HTTP_403_FORBIDDEN)

class JournalEditSerializer(serializers.ModelSerializer):
    class Meta:
        model = JournalModel
        fields = ['journal_comment','journal_rating','machine','follow_up']

